INSERT INTO [CatalogManagementDB].[dbo].[Clientes]
           ([IdCliente] ,[NombreCliente] ,[Email] ,[RFC] ,[CalleDomicilioFiscal] ,[NumeroInteriorDomicilioFiscal] ,[NumeroExteriorDomicilioFiscal] ,[ColoniaDomicilioFiscal] ,[CodigoPostalDomicilioFiscal]
           ,[CiudadDomicilioFiscal] ,[EstadoDomicilioFiscal] ,[Telefono] ,[Observaciones] ,[Adeudo] ,[UltimaCompra] ,[Puntos] ,[IdTipoPrecio] ,[PorcentajeDescuento])
     
SELECT RTRIM(clave) AS IdCliente, 
		RTRIM([nombre]) + isnull(' ' + RTRIM([comercial]) ,'')as NombreCliente, 
		RTRIM(email) as Email, 
		RTRIM(rfc) + ISNULL(' ' + RTRIM(curp),'') as RFC, 
		RTRIM(direccion) + ISNULL(' ' + RTRIM(ubicacion),'') as  CalleDomicilioFiscal, 
		RTRIM(numint) as NumeroInteriorDomicilioFiscal, 
		RTRIM(numext) as NumeroExteriorDomicilioFiscal, 
		RTRIM(colonia) as ColoniaDomicilioFiscal, 
		RTRIM(cp) as CodigoPostalDomicilioFiscal,
		ISNULL(RTRIM(delegacion),'') + ISNULL(' ' + RTRIM(poblacion),'') as  CiudadDomicilioFiscal, 
		RTRIM(entfed) AS EstadoDomicilioFiscal, 
		ISNULL(RTRIM(telefono),'') + ISNULL(' '+ RTRIM(fax),'') as Telefono, 
		RTRIM(observacion) AS Observaciones, 
		ISNULL(saldo_cxc,0) as Adeudo, 
		f_ult_venta as UltimaCompra,
		puntos as Puntos,
		LP.idreg as IdTipoPrecio,
         p_descuento1 as PorcentajeDescuento
    
  FROM [BONETA2019Mar].[dbo].[clientes] c
  left join [BONETA2019Mar].[dbo].[listaprecio] lp on lp.idinterno = c.idlistaprecio
    
