DELETE FROM [CatalogManagementDB].[dbo].[Precio]
  INSERT INTO [CatalogManagementDB].[dbo].[Precio]
           ([IdProducto]
           ,[IdTipoPrecio]
           ,[IdPresentacion]
           ,[Precio]
           ,[Codigo]
           ,[SeUsa])

select idproducto, IdTipoPrecio, IdPresentacion, precio, codigo, 1 as [SeUsa]
from (  
	  SELECT  art.IdProducto, art.Codigo as clave, lp.idreg as IdTipoPrecio , 1 as cantidad  ,[precio1]  as precio , null as codigo
	  FROM [BONETA2019Mar].[dbo].[precios] p
	  inner join [CatalogManagementDB].[dbo].[Producto] art on art.Codigo = p.clave_pri
	  inner join [BONETA2019Mar].[dbo].[listaprecio] lp on lp.idinterno = p.idlistaprecio
	  inner join [BONETA2019Mar].[dbo].[articulos] a on a.idinterno = p.idarticulo
union
	  SELECT  art.IdProducto, art.Codigo as clave , lp.idreg as IdTipoPrecio,a.factor1 as cantidad ,[precio2] as precio , (case lp.idreg when 2 then a.clave_sec_2 else null end)  as codigo
	  FROM [BONETA2019Mar].[dbo].[precios] p
	  inner join [CatalogManagementDB].[dbo].[Producto] art on art.Codigo = p.clave_pri
	  inner join [BONETA2019Mar].[dbo].[listaprecio] lp on lp.idinterno = p.idlistaprecio
	  inner join [BONETA2019Mar].[dbo].[articulos] a on a.idinterno = p.idarticulo
	  WHERE a.clave_sec_2 is not null
union
	  SELECT  art.IdProducto, art.Codigo as clave, lp.idreg as IdTipoPrecio ,a.factor2 * a.factor1 as cantidad ,[precio3] as precio,(case lp.idreg when 3 then  a.clave_sec_3 else null end) as codigo
	  FROM [BONETA2019Mar].[dbo].[precios] p
	  inner join [CatalogManagementDB].[dbo].[Producto] art on art.Codigo = p.clave_pri
	  inner join [BONETA2019Mar].[dbo].[listaprecio] lp on lp.idinterno = p.idlistaprecio
	  inner join [BONETA2019Mar].[dbo].[articulos] a on a.idinterno = p.idarticulo
	  WHERE a.clave_sec_3 is not null

  ) as precios
  inner join  [CatalogManagementDB].[dbo].Presentacion p on p.Piezas = precios.cantidad and p.IdPresentacion > 0

  USE CatalogManagementDB
GO



