MERGE INTO [dbo].[informacion] AS Target
USING (VALUES
  (1,,200,N'El interior es lo que cuenta',N'No se aceptan cambios ni devoluciones\nen ropa interior\n\nTel (33) 3650 3725\nWhatsApp +52 1 33 1337 9454\nLos Angeles #283\nCol. Las Conchas Guadalajara Jalisco Mex.\nMUCA880523HQ5',8,8,8,8,300)
) AS Source ([Id],[LogoTicket],[AnchoMaxLogo],[LeyendaSuperiorTicket],[LeyendaInferiorTicket],[TamañoFuenteLeyenda],[TamañoFuenteTicket],[TamañoFuenteEncabezados],[TamañoFuenteTotales],[AnchoTicket])
ON (Target.[Id] = Source.[Id])
WHEN MATCHED AND (
	NULLIF(Source.[LogoTicket], Target.[LogoTicket]) IS NOT NULL OR NULLIF(Target.[LogoTicket], Source.[LogoTicket]) IS NOT NULL OR 
	NULLIF(Source.[AnchoMaxLogo], Target.[AnchoMaxLogo]) IS NOT NULL OR NULLIF(Target.[AnchoMaxLogo], Source.[AnchoMaxLogo]) IS NOT NULL OR 
	NULLIF(Source.[LeyendaSuperiorTicket], Target.[LeyendaSuperiorTicket]) IS NOT NULL OR NULLIF(Target.[LeyendaSuperiorTicket], Source.[LeyendaSuperiorTicket]) IS NOT NULL OR 
	NULLIF(Source.[LeyendaInferiorTicket], Target.[LeyendaInferiorTicket]) IS NOT NULL OR NULLIF(Target.[LeyendaInferiorTicket], Source.[LeyendaInferiorTicket]) IS NOT NULL OR 
	NULLIF(Source.[TamañoFuenteLeyenda], Target.[TamañoFuenteLeyenda]) IS NOT NULL OR NULLIF(Target.[TamañoFuenteLeyenda], Source.[TamañoFuenteLeyenda]) IS NOT NULL OR 
	NULLIF(Source.[TamañoFuenteTicket], Target.[TamañoFuenteTicket]) IS NOT NULL OR NULLIF(Target.[TamañoFuenteTicket], Source.[TamañoFuenteTicket]) IS NOT NULL OR 
	NULLIF(Source.[TamañoFuenteEncabezados], Target.[TamañoFuenteEncabezados]) IS NOT NULL OR NULLIF(Target.[TamañoFuenteEncabezados], Source.[TamañoFuenteEncabezados]) IS NOT NULL OR 
	NULLIF(Source.[TamañoFuenteTotales], Target.[TamañoFuenteTotales]) IS NOT NULL OR NULLIF(Target.[TamañoFuenteTotales], Source.[TamañoFuenteTotales]) IS NOT NULL OR 
	NULLIF(Source.[AnchoTicket], Target.[AnchoTicket]) IS NOT NULL OR NULLIF(Target.[AnchoTicket], Source.[AnchoTicket]) IS NOT NULL) THEN
 UPDATE SET
  [LogoTicket] = Source.[LogoTicket], 
  [AnchoMaxLogo] = Source.[AnchoMaxLogo], 
  [LeyendaSuperiorTicket] = Source.[LeyendaSuperiorTicket], 
  [LeyendaInferiorTicket] = Source.[LeyendaInferiorTicket], 
  [TamañoFuenteLeyenda] = Source.[TamañoFuenteLeyenda], 
  [TamañoFuenteTicket] = Source.[TamañoFuenteTicket], 
  [TamañoFuenteEncabezados] = Source.[TamañoFuenteEncabezados], 
  [TamañoFuenteTotales] = Source.[TamañoFuenteTotales], 
  [AnchoTicket] = Source.[AnchoTicket]
WHEN NOT MATCHED BY TARGET THEN
 INSERT([Id],[LogoTicket],[AnchoMaxLogo],[LeyendaSuperiorTicket],[LeyendaInferiorTicket],[TamañoFuenteLeyenda],[TamañoFuenteTicket],[TamañoFuenteEncabezados],[TamañoFuenteTotales],[AnchoTicket])
 VALUES(Source.[Id],Source.[LogoTicket],Source.[AnchoMaxLogo],Source.[LeyendaSuperiorTicket],Source.[LeyendaInferiorTicket],Source.[TamañoFuenteLeyenda],Source.[TamañoFuenteTicket],Source.[TamañoFuenteEncabezados],Source.[TamañoFuenteTotales],Source.[AnchoTicket])
WHEN NOT MATCHED BY SOURCE THEN 
 DELETE
;
